import { useEffect } from "react"
import React from 'react'
import { useNavigate} from 'react-router-dom';

const HomePatient = () => {
    const navigate = useNavigate()
    useEffect = () => {
        if(!sessionStorage.getItem('patient_authenticated'))
            navigate()
    }
    return(
        <div>
            <p>Home page</p>

        </div>
    )


}

export default HomePatient
